import { uuid } from 'uuidv4';

let dummyTodos = [

    {
        id: uuid(),
        title: "Todo1 title 1",
        desc: "Todo1 Desc"

    },

    {
        id: uuidv4(),
        title: "Todo2 title 2",
        desc: "Todo2 Desc"

    }
]

export default dummyTodos;
